  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Washington
  Islands NWRs (Flattery Rocks, Quillayute Needles, and Copalis Rock NWRs) outlines
  Refuge accomplishments during the 1988 calendar year. The report begins with a summary
  of the year's highlights and weather conditions. The report includes a planning
  section which discusses research and investigations. Refuge administration is outlined;
  information about personnel and technical assistance is given. Habitat management
  is also covered; subjects include wilderness areas. The wildlife section of the
  report discusses endangered and threatened species, marsh birds and waterbirds,
  shorebirds, and animal control. The public uses of the Refuge described in this
  report include wildlife observation and law enforcement. Cooperative programs are
  provided at the end. Refuge brochures and newspaper articles are attached.\",\n\t\"license_title\":
